import React from "react";
import { Link } from "react-router-dom";
import SectionWithImg from "../Components/sectionWithImage";

function NotFound() {
  return (
    <SectionWithImg
      text={
        <h3>
          Return To <Link to="/">HOME</Link>
        </h3>
      }
    />
  );
}

export default NotFound;
